Up until now, there was now control flow statement involved in our program. In this section, I will describe control flow in our symbolic execution engine. Monster generates a so called Control Flow Graph, which encaptures all possible execution paths of a program in a graph. Let's take a different example with non-trivial control flow: Here is the C pseudo code of the program: uint64_t input = ?;
uint64_t x1 = input + 5;
uint64_t x2 = 10; uint64_t exit_code;
if (x1 == x2) exit_code = x2;
else exit_code = x1; exit(exit_code); RISC-V addi t0, zero, 10
addi t1, a0, 5
beq t0, t1, 2
sd sp(0), t0
jal zero, 2
sd sp(0), t1
ld sp(0), a0
addi a7, zero, 93
ecall The control flow graph for this program looks like this: %3addi(t0, zero, 10)addi(t0, zero, 10)addi(t1, a0, 5)addi(t1, a0, 5)addi(t0, zero, 10)-&gt;addi(t1, a0, 5)beq(t0, t1, 2)beq(t0, t1, 2)addi(t1, a0, 5)-&gt;beq(t0, t1, 2)sd(sp(0), t0)sd(sp(0), t0)beq(t0, t1, 2)-&gt;sd(sp(0), t0)reg(t0) != reg(t1)sd(sp(0), t1)sd(sp(0), t1)beq(t0, t1, 2)-&gt;sd(sp(0), t1)reg(t0) == reg(t1)jal(zero, 2)jal(zero, 2)sd(sp(0), t0)-&gt;jal(zero, 2)ld(sp(0), a0)ld(sp(0), a0)sd(sp(0), t1)-&gt;ld(sp(0), a0)addi(a7, zero, 93)addi(a7, zero, 93)ld(sp(0), a0)-&gt;addi(a7, zero, 93)jal(zero, 2)-&gt;ld(sp(0), a0)ecallecalladdi(a7, zero, 93)-&gt;ecall It is a straight forward Control Flow Graph, where every node is a RISC-U instruction and an edge encodes an optional constrain when branch decisions are made.
